import logo from "./logo.svg";
import background from "./background-pattern-desktop.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="img-container">
        <img src={background} alt="" />
      </div>
    </div>
  );
}

export default App;
